import {React} from 'react';
import {Link} from 'react-router-dom';
import "./TeamTile.scss";

export const TeamTile =({teamName}) => {
    var teamsList = {
        RR:"-Logo.png",
        CSK:"-Logo.png",
        DC:"-Logo.jpg",
        GL:"-Logo.jpg",
        GT:"-Logo.png",
        KKR:"-Logo.png",
        Kochi:"Ko-Logo.png",
        LSG:"-Logo.png",
        MI:"-Logo.png",
        PBKS:"-Logo.png",
        PWI:"-Logo.jpg",
        RCB:"RLogo.png",
        RPS:"-Logo.jpg",
        SRH:"-Logo.png"
    }

return(
    <div className="TeamTile">
        <h1>
            <Link to={`/team/${teamName}`}>
                <img src="%PUBLIC_URL%/Teams_Logo/" alt="team-logo"/>
            </Link>
        </h1>
    </div>
)
}
